window.bookSummaryJSON = "<p>My prison pen pal got the electric chair.</p> <p>So how can he sext me from the grave?</p> <p>Prey</p> <p>I see dead people, and not just the men I murdered.</p> <p>I'm in danger of being committed because I can’t tell what’s real from my hallucinations.</p> <p>Everyone thinks I’m crazy when the serial killer I jilted starts haunting my house.</p> <p>He assassinates any man who shows me interest, leaving their body parts under my pillow.</p> <p>During the day, his gaslighting destroys my peace of mind.</p> <p>But at night, he invades my nightmares and makes me crave the depravity.</p> <p>Predator</p> <p>She ghosted me at the altar. Now, I’m aching for revenge.</p> <p>I want to break her, piece by delicious piece. Revel in her terror. Bathe in her screams. Make her moan my name.</p> <p>Someone from her past wants her captured or dead, so it’s up to me to protect her from the shadows.</p> <p>She belongs to me and no one else—body, mind, and soul.</p> <p>If I don’t take out her enemies, I’ll lose more than just my beautiful obsession.</p> <p>I Will Break You is a dark psychological thriller romance with unreliable narrators, and disturbing themes. It ends on a cliffhanger. Please check the trigger warnings.</p>"; 
